import { createApp } from 'vue';
import App from './App.vue';
import { createRouter, createWebHistory } from 'vue-router';

import Catalog from './pages/RentalCatalog.vue';
import RentalCart from './pages/RentalCart.vue';
import Checkout from './pages/OrderCheckout.vue';

const routes = [
  { path: '/', redirect: '/catalog' },
  { path: '/catalog', component: RentalCatalog },
  { path: '/cart', component: RentalCart },
  { path: '/checkout', component: OrderCheckout },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

createApp(App).use(router).mount('#app');
